import './../style/Counter.css'

function Counter(props) {
    return (
        <div className='counter'>
        <button className='counter-button'>-</button>
        <span className='counter-text'>{props.count}</span>
        <button className='counter-button'>+</button>
        </div>
    );
}

Counter.defaultProps = {
    count: 0
}
export default Counter
